import './App.css';
import { Container, Row, Col, Form, FormGroup, Label, Input, Button, Card } from "reactstrap";
//import { Link, useNavigate, BrowserRouter as Router, Route, Routes } from "react-router-dom";
import Lab from './components/Lab';


function App() {

  // const navigate = useNavigate();
  var password = 123;

  function btnclk() {
    // if (password === 123) {
    //   navigate("/Lab");
    // }
    alert("hey")
  }
  return (
    <div>
      {/* <Router>
        <Container>
          <Link to="/"></Link>
          <Link to="/Lab"></Link>

        </Container>
        <Routes>
          <Route path="/" element={<App />} />
          <Route path="/Lab" element={<Lab />} />
        </Routes> */}

        <div className='bor bg-dark'>
          <Container >
            <Row>
              <Col className='borr'>
                left
              </Col>

              <Col className='borl'>
                right
              </Col>
            </Row>
          </Container>

          <div>
            <Card style={{
              width: '18rem'
            }} className="loc rounded-circle border-info bg-dark">
              <img src="https://cdn-icons-png.flaticon.com/512/25/25968.png" width="90px" className='btnn'></img>

              <Form>
                <FormGroup>
                  <Label
                    for="examplePassword"
                    className='card text-center'
                  >
                    ENTER YOUR LEARNING PASSWORD
                  </Label>
                  <Input
                    id="Password"
                    name="password"
                    placeholder="Password"
                    type="password"
                    className='text-center'
                  />
                </FormGroup>
                <Button  onClick={btnclk()} className='btnn btn-lg text-dark bg-info'>
                  Enter Lab
                </Button>
              </Form>

            </Card>
          </div>

          <Container>
            <Row>
              <Col className='borr'>
                left
              </Col>

              <Col className='borl'>
                right
              </Col>
            </Row>
          </Container>

        </div>
    {/* </Router> */}
    </div>

  );
}

export default App;
